import React, { Component } from 'react';
import { connect } from 'react-redux';

class FormDataDisplay extends Component {
  render() {
    // Recupere as informações do seu estado criado no Redux
    const { Nome, Email, Cpf, Endereco,
      Cidade, estado, Curriculo, Cargo, Descricao } = this.props;
    return (
      <div>
        <div>
          <header>
            <h2>Dados enviados</h2>
          </header>
        </div>
        <div className="div-dados-enviados">
          <div>
            <strong>Nome:</strong>
            {`${Nome}`}
          </div>
          <div>
            { `Email: ${Email}` }
          </div>
          <div>
            {`CPF: ${Cpf}`}
          </div>
          <div>
            {`Endereço: ${Endereco}`}
          </div>
          <div>
            {`Cidade: ${Cidade}`}
          </div>
          <div>
            {`Estado: ${estado}`}
          </div>
          <div>
            {`Currículo: ${Curriculo}`}
          </div>
          <div>
            {`Cargo: ${Cargo}`}
          </div>
          <div>
            {`Descrição do Cargo: ${Descricao}`}
          </div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  Nome: state.Nome,
  Email: state.Email,
  Cpf: state.Cpf,
  Endereco: state.Endereco,
  Cidade: state.Cidade,
  estado: state.estado,
  Curriculo: state.Curriculo,
  Cargo: state.Cargo,
  Descricao: state.Descricao,
});

export default connect(mapStateToProps)(FormDataDisplay);
